import "./App.css";
import { Routes, Route } from "react-router-dom";
import Header from "./Components/Header";
import Branch from "./Pages/Branch";
import Home from "./Pages/Home";

function App() {
  return (
    <div className="App">
      <Header></Header>
      <Routes>
        <Route to="/" element={<Home />} />
        <Route to="/Branch" element={<Branch />} />
      </Routes>
    </div>
  );
}

export default App;
